import react from 'react';

// Dummy component
const MyNav = props => {
	return (
		<ul style={styles.myNav}>
			<li>
				<a href="">News Feed</a>
			</li>
			<li>
				<a href="">Messages</a>
			</li>
			<li>
				<a href="">Watch</a>
			</li>
		</ul>
	);
};

// Export
export default MyNav;

// Styling
const styles = {
	myNav: {
		listStyle: 'none',
		padding: 0,
		margin: '20px',
		display: 'flex',
		flexDirection: 'column',
		justifyContent: 'space-between',
		height: '300px',
	},
};
